import { useGetSpotifyTrackQuery } from "./app/apiSlice";
import { useLocation } from "react-router-dom";

const SongInfo = () => {
  const location = useLocation();
  const { data } = location.state;

  const { data: track, isLoading } = useGetSpotifyTrackQuery(data.track["id"]);
  if (isLoading) {
    return <progress className="progress is-primary" max="100"></progress>;
  }
  console.log(track[0][1]);
  return (
    data && (
      <div className="row mt-3">
        <h1>
          <img
            src={track[0]["album_info"]["image"]}
            width="200px"
            height="200px"
          ></img>
        </h1>
        <h1>{track[0]["track_info"]["name"]}</h1>
        <table className="table table-striped">
          <thead>
            <tr>
              <th>Name</th>
            </tr>
          </thead>
          <tbody>
            {track[0][1]?.track.map((tracks) => {
              console.log(tracks.track_info.id);
              return (
                <tr key={tracks.track_info.id}>
                  <td>{tracks.track_info.artist_name}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    )
  );
};
export default SongInfo;
